window.bookSummaryJSON = "<i>The Mighty Boosh</i> is unlike any show you are ever likely to hear, and one that defies description; the closest you could get to the unique style of Julian Barratt and Noel Fielding would be in the early days of Reeves and Mortimer, with their cardboard props and men with sticks. <p>But unlike Reeves and Mortimer, the Boosh zookeepers turned postmen Howard Moon (Julian) and Vince Noir (Noel), never leave their own world. <i>The Mighty Boosh</i> inhabits a universe entirely of its own.<br><br><b>Bonus:</b>This audio programme also contains an interview with the creators Noel and Julian plus outtakes from the show.</p>"; 
